import React from "react";

//Components
import { Header } from "./components/header";
import { MainPresentation } from "./components/mainPresentation";
import { MainIcons } from "./components/mainIcons";
import { RigthMenu } from "./components/rigthMenu";
import { AllYourNeeds } from "./components/allYourNeeds";
import { Form } from "./components/form";
import { Footer } from "./components/footer";


// Style
import settings from './styles/settings.css'

function App() {
  return (
    <React.Fragment>
      <RigthMenu />

      <header>

        <Header />

      </header>

      <main>

        <section className = 'main-presentation'>

          <MainPresentation />

        </section>

        <section className='main-icons'>

          <MainIcons />

        </section>

        <section className='all-your-needs'>

          <AllYourNeeds />

        </section>

        <section className='form' id="form">

          <Form />

        </section>

      </main>

      <footer>

        <Footer />

      </footer>

    </React.Fragment>
  );
}

export default App;
